import { useEffect, useState } from 'react';
import './App.css';

function App() {

  const [cards, setCards] = useState([]);

  useEffect(() =>{

    async function handleGetCard(){
    const response = await fetch('http://localhost:3333/cards?_limit=20');
    const data = await response.json();
    setCards(data);
    }

    handleGetCard();

  }, []);

  return (
    <div >
      {
        cards.map((card) => {
          <div>
            {card.name}
          </div>
        })
      }
    </div>
  );
}

export default App;
